import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { useState } from "react";
import Todo from "./Todo";

export default function Todos(){

    const [todoHeadline, setTodoHeadline] = useState("");
    const [todoDescription, setTodoDescription] = useState("");
    const [id, setId] = useState(3);
    const [todos, setTodos] = useState([
        {
        id: 1,
        headline: 'Doctor Appointment',
        description: "6:30"
        },
        {
        id: 2,
        headline: 'Meeting at School',
        description: "9:30"
        }
        ]);

    function addTask (headline1,description1) {
        setId(id+1);
        const newTask = {
            id,
            headline1,
            description1
            };
        setTodos([...todos, newTask]);
        console.log(todos);
        console.log(todos.length);
        //setTodoHeadline("");
        //setTodoDescription("");
    }

    return(
        <>
            <div className="container">
                    <div className="text-center fs-1 bg-dark text-white rounded p-5">
                    Todo App
                    </div>
                    <div className="text-center p-3">
                        <div class="container">
                            <div class="row justify-content-start">
                                <div class="col-4 fs-5 bg-primary text-white rounded-start p-3">
                                    Today
                                </div>
                                <div class="col-3 fs-5 bg-secondary text-white mx-1 p-3">
                                    Pending
                                </div>
                                <div class="col-4 fs-5 bg-secondary text-white rounded-end p-3">
                                    Overdue
                                </div>
                            </div>
                        </div>
                    </div>
                <div>

                <div class="row justify-content-start">
                    <div class="col-6 fs-3">Tasks</div>
                    <div class="col-6 text-end">
                    <button type="button" className="btn btn-success fs-5" data-toggle="modal" data-target="#exampleModalCenter">
            + Add Task
            </button>

            <div className="modal fade" id="exampleModalCenter" tabindex="-1" role="dialog" aria-labelledby="exampleModalCenterTitle" aria-hidden="true">
                <div className="modal-dialog modal-dialog-centered" role="document">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h3 className="modal-title mx-4" id="exampleModalLongTitle">Please add your task </h3>
                        </div>
                    <div class="modal-body">
                        <form>
                            <div class="mb-3">
                                <label for="exampleInputEmail1" class="form-label text-start">Task headline...</label>
                                <input type="text" 
                                placeholder="write your task headline..." 
                                class="form-control" id="exampleInputEmail1" 
                                aria-describedby="emailHelp"
                                value={todoHeadline}
                                onChange={e => setTodoHeadline(e.target.value)}
                                />
                            </div>
                            <div class="mb-3">
                                <label for="exampleInputPassword1" class="form-label">Description</label>
                                <textarea 
                                 placeholder="write your task decsciption..."
                                 class="form-control" id="exampleInputPassword1"
                                 value={todoDescription}
                                 onChange={e => setTodoDescription(e.target.value)}
                                 />
                            </div>
                            <button type="submit" class="btn btn-primary">Add</button>
                        </form>
                    </div>
                    <div className="modal-footer">
                        <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                        <button type="button" onClick={() => addTask(todoHeadline,todoDescription)} className="btn btn-primary">Save changes</button>
                    </div>
                    </div>
                </div>
            </div>
                    </div>
                </div>
                <div>
                    {todos.map(task => {
                        <div>{task.headline}</div>
                    })}
                </div>
                <div>
                    {todos[1].headline}
                </div>
                <Todo/>
            </div>
           </div>
        </>
    )
}
